
<!DOCTYPE html>

<head>

  <title>Mapa Interactivo Expo</title>
  <style>
    body {
      background: #fff;
      margin: 0;
      padding: 0;
      font-family: sans-serif;
    }

    svg {
      width: 100%;
      height: auto;
      display: block;
    }

    .tooltip {
      position: absolute;
      background: #b80000;
      color: #fff;
      padding: 8px 14px;
      border-radius: 6px;
      box-shadow: 0 2px 8px rgba(0,0,0,0.2);
      pointer-events: none;
      font-size: 14px;
      white-space: nowrap;
      z-index: 1000;
      opacity: 0;
      transition: opacity 0.2s ease-in-out;
    }

    .interactive {
      cursor: pointer;
      transition: fill 0.3s;
    }

    .interactive:hover {
      fill: #ffcccc !important;
    }
  </style>
</head>

    const tooltip = document.getElementById('tooltip');

    const datosEjemplo = {
      'stand-1': 'Stand de Prueba\nCategorÃ­a: Marketing\nNÃºmero: 101',

    };

    document.querySelectorAll('.interactive').forEach(el => {
      el.addEventListener('mousemove', (e) => {
        const info = datosEjemplo[el.id] || 'Stand sin informaciÃ³n';
        tooltip.innerText = info;
        tooltip.style.left = e.pageX + 10 + 'px';
        tooltip.style.top = e.pageY + 10 + 'px';
        tooltip.style.opacity = 1;
      });

      el.addEventListener('mouseleave', () => {
        tooltip.style.opacity = 0;
      });
    });
